function Bluetooth_Callback(hObject, eventdata, handles)
% hObject    handle to Bluetooth (see GCBO)
% eventdata  reserved - to be defined in a future version of MATLAB
% handles    structure with handles and user data (see GUIDATA)

global timer_Bluetooth
global first 
first = true



function Read_data_3D(Bluetooth_device)
global Matrix_3D
global index
global last_size_y;
global fid;

fprintf(Bluetooth_device, '3D'); %request new value from Arduino

received = fgetl(Bluetooth_device) %read the requested data

w = warning('query','last');
id = w.identifier;
warning('off',id)

if received ~= 0
    disp('Received message') 

    distance = extractBetween(received,'D','X'); 
    %distance = char(distance)
    distance = str2double(distance);    
    x_position = extractBetween(received,'X','Y')
    x_position = str2double(x_position)
    y_position = extractBetween(received,'Y','D') %cell array
    y_position = str2double(y_position)
    y_size= numel(x_position)+ last_size_y;
    resetable_index = 1; %index for distance array
    fprintf(fid,'%g\n', x_position);
    for index=last_size_y:y_size 
        if resetable_index >= numel(distance)
             resetable_index = 1;
        else
            Matrix_3D(x_position+1,(151-y_position(resetable_index))) = distance(resetable_index);
            resetable_index = resetable_index+1
            fprintf(fid,'%g\t',distance(resetable_index));

        end
    end
            
end
